import React, { useState } from 'react';
import './User1.css';

const Users = () => {
  const [isEventsOpen, setIsEventsOpen] = useState(false);

  // Toggle the dropdown for the "Event Names" section
  const toggleEventsDropdown = () => {
    setIsEventsOpen(!isEventsOpen);
  };

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h3>
          <img src="https://via.placeholder.com/20" alt="Client" className="client-icon" />
          Client Name
        </h3>
        <ul>
          <li className="bullet-item"><span>• Overview</span></li>
          <li className="bullet-item"><span>• Events</span></li>
          <li>
            <a href="#event-names" onClick={toggleEventsDropdown} className={`dropdown-toggle ${isEventsOpen ? 'open' : ''}`}>
              <img src="https://via.placeholder.com/15" alt="Events Icon" className="icon" />
              Event Names
            </a>
            {isEventsOpen && (
              <ul className="dropdown-menu">
                <li><a href="#event-overview">Overview</a></li>
                <li><a href="#registrations">Registrations</a></li>
                <li><a href="#forms">Forms</a></li>
                <li><a href="#designs">Designs</a></li>
                <li><a href="#lunch-dinner">Lunch/Dinner</a></li>
                <li><a href="#kit">Kit</a></li>
                <li><a href="#scanner">Scanner</a></li>
                <li><a href="#event-settings">Event Settings</a></li>
              </ul>
            )}
          </li>
          <li>
            <a href="#account">
              <img src="https://via.placeholder.com/15" alt="Account Icon" className="icon" />
              Account
            </a>
          </li>
          <li className="active">
            <a href="#users" className="active-link">
              <img src="https://via.placeholder.com/15" alt="Users Icon" className="icon" />
              Users
            </a>
          </li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="main-content">
        {/* Your main content here */}
      </div>
    </div>
  );
};

export default Users;
